import React from 'react'

export default function Inventory() {
    return(
        <div>
            <h2>Inventory</h2>
            <p>I would very much like to see my inventory</p>
            <button onClick={this.props.history.push('/dashboard')}>Dashboard</button>
        </div>

    )
}
